import Link from 'next/link'

export function MainLayout({children}) {
    return (
        <>
        <nav>
            <Link className="navlink" href={'/'}> <a>Home</a></Link>
            <Link className="navlink" href={'/about'}><a>About</a> </Link>
            <Link className="navlink" href={'/posts'}><a>Posts</a> </Link>
        </nav>
        <main>
            {children}
        </main>

        <style jsx>
            {`
                nav {
                    position: fixed;
                    top: 0;
                    left: 0;
                    right: 0;
                    height: 60px;
                    background: darkblue;
                }
                nav a {
                    color: white;

                }
                main {
                    margin-top: 60px;
                }
            `}
        </style>
        </>
    )
}
